import React from 'react'
import { Album, FlexWrapper, Title } from './Styled'
import album from '../assets/folk.png';
import album2 from "../assets/rep.png";

function Albums() {
  return (
    <>
      <Title padding="20px 0">Popular Albums</Title>
      <FlexWrapper></FlexWrapper>
      <Album>
        <img src={album} alt="" />
        <Title>Folklore</Title>
      </Album>
      <Album>
        <img src={album2} alt="" />
        <Title>Folklore</Title>
      </Album>
    </>
  );
}

export default Albums
